import React from 'react';
import styled from 'styled-components';

const MainViewContainer = styled.div`
  padding: 2rem;
  color: white;
`;

function MainView() {
  return (
    <MainViewContainer>
      <h1>Welcome to Spotify Clone</h1>
      <p>Start exploring music!</p>
    </MainViewContainer>
  );
}

export default MainView;
